ESPTimer={initialized:!1,model:{},show(){this.modal.show()},setup(){if(this.initialized)return;this.initialized=!0,this.modal=document.getElementById("espTimerSetupModal");let table=Utils.createModalTableSection(this.modal,"Timer setup"),availableTimers=systemInfo.availableTimers;for(let index=0;index<availableTimers.length;index++){const element=availableTimers[index];let timerFrequencyRow=Utils.createNumericFormRow(0,element.name+" (hz)","timerFrequency"+index,element.frequency,50,8e7,function(element){element.frequency=this.value,updateUserSettings()}.bind(this,element));timerFrequencyRow.title="Set the frequency of this timer",table.body.appendChild(timerFrequencyRow.row)}}};